import React from "react";

export default function Card ({id, info, name, price, waist, image}){
    console.log(id, info , price, waist);
    return (
        <div className = 'Card'>
            <h3>{name}</h3>
            <h3>{id}</h3>
            <h3>{info}</h3>
            <h3>{price}</h3>
            <h3>{waist}</h3>
            <img src={image} alt='not found' ></img>
        </div>
    )
}
